INSERT INTO `tb_board` VALUES (1,'','문의드립니다.','','Y','1111','신초','','ㅇㅇㅇㅇㅇㅇㅇㅇㅇㅇ','','N',9,1,'A','N','','','','','Y','','2014-10-13 15:51:13'),(2,'','테이블 문의 드립니다.','','Y','0901','유용욱','','<img alt=\\\"\\\" src=\\\"/ckeditor/upload/2015/1429497454.74.jpg\\\" style=\\\"height:295px; width:740px\\\" />테이블 제작 이사이즈로 문의 드립니다. 집성목으로 예정입니다.<br />\r\n현 A테이블이의 대자랑 소자 붙이면 싸이즈랑 비슷한거 같은데정정확한 사이즈와 가격 좀 알수 있을까요?','안녕하세요 더에프 입니다.<br />\r\n<img alt=\\\"\\\" src=\\\"/ckeditor/upload/2015/1429580326.96.jpg\\\" style=\\\"height:500px; width:379px\\\" /><br />\r\n첨부한 이미지처럼 상판 집성원목과 다리는 무늬목으로 제작이 가능합니다.<br />\r\n집성목 특성상 보내주신 이미지처럼 하나의 테이블로 만드는 것은 불가능 하며, 두개의 테이블을 만들어서 붙여 사용하셔야 합니다.<br />\r\n금액은 60만원이며, 제작기간은 일주일 주셔야 합니다.<br />\r\n그리고 문의하신 A테이블은 수입 기성제품이며, 현재 재고는 &#39;대&#39; 밖에 없으며, 다음주중에 수급이 가능합니다.<br />\r\n싸이즈는 W1100*D600*H730이며, 금액은 15만원입니다.<br />\r\n모든 제품은 부가세, 운임 별도 입니다.<br />\r\n담당은 신하림대리입니다.<br />\r\n감사합니다. 좋은하루 되세요~','N',70,2,'A','N','','','','','Y','2015-04-21 11:35:15','2015-04-20 12:13:15');
/*!40000 ALTER TABLE `tb_board` ENABLE KEYS */;
