  `uname` varchar(50) NOT NULL DEFAULT '' COMMENT '이름',
  `content` text NOT NULL COMMENT '내용',
  `ref` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '조회수',
  `tegtype` enum('Y','N') NOT NULL DEFAULT 'Y',
  `fileadd_name` varchar(255) DEFAULT NULL,
  `fileadd_org` varchar(255) DEFAULT NULL,
  `fileadd1_name` varchar(255) DEFAULT NULL,
  `fileadd1_org` varchar(255) DEFAULT NULL,
  `fileadd2_name` varchar(255) DEFAULT NULL,
  `fileadd2_org` varchar(255) DEFAULT NULL,
  `fileadd3_name` varchar(255) DEFAULT NULL,
  `fileadd3_org` varchar(255) DEFAULT NULL,
  `fileadd4_name` varchar(255) DEFAULT NULL,
  `fileadd4_org` varchar(255) DEFAULT NULL,
  `reg_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '등록일',
  PRIMARY KEY (`uid`)
) ENGINE=MyISAM AUTO_INCREMENT=569 DEFAULT CHARSET=utf8;
